contents:
그지같아서 사진도 안찍었네 젠장..
주문받았으면서 까먹어놓고 우리 방치하다가 우리가 물어보니까 
&ldquo;주문을 안하셨네~&rdquo;
안했겠냐고 배고파서 밥먹을라고 앉아있는데 우리가 거기서 뭐하겠다고 20분동안 앉아있었겠냐고;;;;;
그러고 나 힘줄쌀국수? 뭐 그거 시켰는데 고기 안쪽이 차가움ㅋㅋㅋㅋㅋㅋ진짜 미친건가 했음ㅋㅋ 맛은 어땠는지 기억도 안남 짜증나서 그냥 먹기싫었음;; 그래도 시켰으니 돈아까워서라도 먹어야지 젠장;;;; 여러분 제발 가지말아주세요

냄새나서 한입먹고 안먹음;
웬만하면 먹을텐데 진짜 못먹겠음....
친구는 잘먹더라구요..ㅎ

음&hellip; 가격 대비 너무 별로&hellip;&hellip;&hellip; 
웨이팅한 시간 너무 아깝&hellip;
돈 너무 아깝&hellip;

다른지점보다 맛있어서 먼길이지만 항상 강남점으로옵니다.
오늘은 2명이서 13만원치 먹었네요^^;
다만 조금 짜서 그런지 집에와서 물 1리터 넘게 마셨어요

2인분인데 바닥이 보일줄 몰랐어요
고기보다 양배추가 더 많은 것 같음&hellip;
걍 느리게 나오고 양도 적고&hellip;

옛날에 장인닭갈비 정말 맛있었는데ㅠ 이제는 닭도 덜 익은데다가 양념도 너무 과하게 달고 치즈추가도 했음에도 불구하고 너무 적게 줍니다&hellip;

닭이 덜 익어서 그런지 비린내가 너무 심합니다..
초심 되찾아주세요;;

차를 가져오시면 서서 기다리는 분들의 자리가 많이 좁아져요..
음식 맛은&hellip;
오지마세요. 나만가고 싶으니까.. 정도의 맛입니다.

진짜 최악, 앵간하면 다 잘 먹고 별 생각없는데

6/6일 6시쯤 방문했는데 음식 30분 넘게 걸려서 나왔는데도 스테이크는 다 식어있음;
심지어 스테이크에 같이 나오는 양송이는 차갑더라구요; 
샐러드 야채도 시들시들해서 아삭아삭한 맛도 없어요 파리바게뜨 샐러드가 더 맛있어여
이런 음식점 처음
맛 없는건 둘째치고 성의 없는 음식이 진짜 최악이네요

맛있는데 가격대는 강남이라 상당함.
전형적인 이자카야 분위기라고 보시면됨

자리에 따라 천장에 난방 바람이 너무 쎄서 눈 건조해서 너무 힘들었음. 에어컨 바람 막이?라던가 아래로 안쏘게 설정을 좀... 일하시는 분들도 어떻게 해결해줄 수 없어서 서로 곤란;;;

비싸고 맛있다..
어흐...;ㅇ;
호불호 있는맛...  녹두전도 괜춘.

3번째 방문&hellip;
이제 요령이 생겨서 ㅎㅎ&hellip;
해장국은 별로에요. 이집은 뼈구이 먹으러 가는곳.
매운거 좋아하시는 분들은 취저일것 같습니다.
등뼈고기를 매운양념해서 불에 살짝 구워 나오는것 같은데 양념이 진짜 맛있네요. 매운거 못드시는분들은 간장양념이 따로 있긴합니다.
가격은 좀 있지만 별미로 즐길만 합니다.
주차는 발렛 가능하구요. 단점은 극악의 웨이팅&hellip;
그나마 저녁 6시 전에 가면 좀 덜기다리는듯?

웨이팅이 미쳤지만 세상 너무 맛있음;;
감자탕보단 저 양념된데 최고.
웨이팅만 아니었음 별5개

Lovely atmosphere and music
Several floors and plenty of tables
Not a certified Harry Potter caf&eacute;

환기가 전혀안됩니다.
갔다왔더니 온몸에 기름냄새 범벅이라 옷을 다 빨았네요;;;

맛도 느끼한걸 제대로 잡아주지 못해서 먹기 어려웠음;;;

이정도면 가성비 최고네요.
고기도 프라임등급으로 부드럽고 맛나요.
웰컴티류 입맛돋구어주고, 소고기국?? 엄청 맛익음;;

색감부터 식감까지 너무 완벽합니다👏👏👏
맛은 당연하구요;; 
신선함이 느껴지는 맛이었습니다!!

처음 와본 곳인데 양도 푸짐하고 넘 맛있어요!!
앞으로 자주 오고 싶어요
직원분들도 친절하시구 다 굽고 잘라주셔서 넘 편해용&gt;&lt;

리뷰쓰려고 맵가입한건 처음이네요... ㅋㅋ;
이벤트 거르고 진짜 맛있습니다.
아쉬운건 가격이 맛있는 만큼 비싸서 딱 맛에 맞는 돈 주고 먹은다는 느낌이라 기분좋은 아쉬움?ㅋㅋㅋㅋㅋㅋ

양대박!!!          

염통 한입먹고 여긴 찐이다 
잘먹겠습니다 ~&gt;♡&lt;

30년 가까이 살면서 제대로 먹은 곱창전골은 처음이다
직원분들도 친절하시고 낮에 와서 사람 없이 너무 좋당&hearts;&hearts;
대창구이도 먹어야지이이이

곱창 비주얼 진짜! Good   맛있어용&gt;.&lt;
해물탕도 같이 나오는데 계속 손이 가는 맛!
담에 또 올라옹!

최악이네요.
전화는 아예 받질 안는군요.
주문배달초포장 변경은 어찌하라는건지&hellip;

200209 다음엔 돈까스 먹어보고싶네

230605 추가 : 간만에 왔는데 월요일 오후 3시 좀 넘어서 왔는데도 웨이팅이 30분 넘게 있었음 웨이팅 무서워서 먹겠나;;;;;
치즈+히레 먹었는데 여태까지 먹어본 치즈돈까스중 제일 괜찮았음. 치즈가 히레보다 낫다.
